import React, { Component, useRef } from "react";
import 'twitch-stream-embed';
import './App.css';


class TwitchView extends Component {
	constructor(props) {
    super(props);

		this.props = props

    this.state = {
      muted: true
    };

  }

	render() {
		this.forceUpdate();
  	return (
  	  <div>
				<twitch-stream channel="ampm_m" setMuted={this.props.muted} />;
  	  </div>
  	);
	}
}

export default TwitchView;
